description:
The Underwater Pixelguide

Arts, Nature Documentary hosted by Kamil Tamiola, published by Postorgasmickitchen in 2012 - English narration


Information
------------------------------

In five chapters The Underwater Pixelguide explores what to shoot, where, when, why and who with. In five more chapters it explores how to do that using camera, casing, color, composition and a lot of caution. Five W's, and five C's add up to an unequalled Underwater Pixelguide shot by three award winning underwater photographers and cineasts who let the amateur photographer in to all their secrets. From the smallest detail of preparation to the magnificence of oceanic amazement they show them the nuts and bolts of underwater photography, of painting with light where shadows rule.
This is basically a how-to guide on underwater photography -KarMa

